69c135b9d3b9d76ae286c0b4fb2c4f8283e28cba:
query NewsfeedQuery {
  topStory {
    ...StoryFragment
    id
  }
}

fragment StoryFragment on Story {
  title
  summary
  createdAt
  poster {
    __typename
    name
    profilePicture {
      url
    }
    ... on Node {
      __isNode: __typename
      id
    }
  }
  thumbnail {
    url
  }
}

909fa7cf535c2587b39854aac4665f8c4320dc55:
query NewsfeedQuery {
  topStory {
    ...StoryFragment
    id
  }
}

fragment PosterBylineFragment on Actor {
  __isActor: __typename
  name
  profilePicture {
    url
  }
}

fragment StoryFragment on Story {
  title
  summary
  createdAt
  poster {
    __typename
    ...PosterBylineFragment
    ... on Node {
      __isNode: __typename
      id
    }
  }
  thumbnail {
    url
  }
}
